        <style>
            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }

            body {
                font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
                background-color: #0a0a0a;
                color: #ffffff;
                line-height: 1.6;
            }

            .container {
                max-width: 1400px;
                margin: 0 auto;
                padding: 40px 20px;
            }

            header {
                text-align: center;
                margin-bottom: 60px;
                padding: 40px 0;
                border-bottom: 2px solid #52B788;
            }

            h1 {
                font-size: 3em;
                font-weight: 300;
                margin-bottom: 10px;
                color: #52B788;
            }

            .subtitle {
                font-size: 1.2em;
                color: #aaaaaa;
                font-weight: 300;
            }

            .section {
                margin-bottom: 80px;
            }

            .section-title {
                font-size: 2em;
                font-weight: 300;
                margin-bottom: 30px;
                color: #52B788;
                border-left: 4px solid #52B788;
                padding-left: 20px;
            }

            .chart-container {
                background-color: #1a1a1a;
                border-radius: 10px;
                padding: 30px;
                margin-bottom: 40px;
                box-shadow: 0 4px 6px rgba(0, 0, 0, 0.3);
            }

            .chart-container img {
                width: 100%;
                height: auto;
                border-radius: 5px;
            }

            .two-column {
                display: grid;
                grid-template-columns: 1fr 1fr;
                gap: 30px;
            }

            footer {
                text-align: center;
                padding: 40px 0;
                border-top: 1px solid #333;
                color: #888;
                font-size: 0.9em;
            }

            @media (max-width: 768px) {
                .two-column {
                    grid-template-columns: 1fr;
                }

                h1 {
                    font-size: 2em;
                }

                .section-title {
                    font-size: 1.5em;
                }
            }
        </style>
